            <button>2</button>
            <button>3</button>
            <button class="operator">+</button>

            <!-- Bottom row -->
            <button>0</button>
            <button>.</button>
            <button class="operator">=</button>
        </div>
    </div>

    <script>
        // JavaScript code
        const display = document.getElementById('display');
        let firstOperand;
        let storedOperator;

        document.addEventListener('DOMContentLoaded', () => {
            const buttons = document.querySelectorAll('.buttons button');

            buttons.forEach(button => {
                button.addEventListener('click', () => handleButton_click(button.innerHTML));
            });
        });

        function handleButton_click(value) {
            if (value === 'AC') {
                clearDisplay();
            } else if ('+-/*'.includes(value)) {
                handleOperator(value);
            } else if (value === '=') {
                calculate();
            } else {
                appendToDisplay(value);
            }
        }

        function appendToDisplay(value) {
            if (value === '.') {
                if (display.value.includes('.')) return;
            }
            if (display.value === '0' && value !== '.') {
                display.value = value;
            } else {
                display.value += value;
            }
        }

        function handleOperator(operator) {
            firstOperand = parseFloat(display.value);
            storedOperator = operator;
            display.value = '0';
        }

        function calculate() {
            if (storedOperator && firstOperand !== undefined) {
                const secondOperand = parseFloat(display.value);
                let result;

                switch(storedOperator) {
                    case '+':
                        result = firstOperand + secondOperand;
                        break;
                    case '-':
                        result = firstOperand - secondOperand;
                        break;
                    case '*':
                        result = firstOperand * secondOperand;
                        break;
                    case '/':
                        if (secondOperand === 0) {
                            display.value = 'Error';
                            return;
                        }
                        result = firstOperand / secondOperand;
                        break;
                }

                display.value = result;
                // Reset for next calculation
                firstOperand = undefined;
                storedOperator = '';
            } else {
                // If no operator was set, just show the number as is
                display.value = parseFloat(display.value);
            }
        }

        function clearDisplay() {
            display.value = '0';
            firstOperand = undefined;
            storedOperator = '';
        }
    </script>
</body>
</html>
